import React, { Fragment } from "react";

const ListOfSplits = () => {
  return (
    <Fragment>
      <table className="table mt-5 text-center">
        <thead>
          <tr>
            <td>Split</td>
            <td>User Id</td>
          </tr>
        </thead>
      </table>
    </Fragment>
  );
};

export default ListOfSplits;
